import { BrowserRouter, Routes, Route } from "react-router-dom";
import './App.css';
import HotelDetail from './component/HotelDetail';
import HotelList from './component/HotelList';


function App() {
  return (
    <>
    <BrowserRouter>
      <Routes>
        <Route index path="/hotels" Component={HotelList}>
        <Route path="/:id" Component={HotelDetail}/>
        </Route>
        {/* <Route path="/hotels/:id" Component={HotelDetail}></Route> */}
        <Route path="*" element={HotelList} />

      </Routes>

    </BrowserRouter>
    </>
  );
}

export default App;
